import { Footer } from "./components/Footer/Footer";
import { Header } from "./components/Header/Header";
import { Home } from "./components/Home/Home";
import { Login } from "./components/Login/Login";

function App() {
  return (
    <div id="box">

        <Header />

        <main id="main-content">

            <Home />
            <Login />


        </main>

        <Footer />
    </div>
  );
}

export default App;
